// src/theme.js

export const lightTheme = {
  body: '#FFF',
  text: "hsl(206deg, 45%, 17%)",
  linkColor: "hsl(206deg, 45%, 17%)"
  // other colors and styles for light theme
};

export const darkTheme = {
  body: "hsl(206deg, 45%, 17%)",
  text: '#FAFAFA',
  linkColor: '#FFF'
  // other colors and styles for dark theme
};
